def bingo(ticket,win):
    counter = 0
    for x,y in ticket:
        for i in x:
            counter += 1 if ord(i) == y else 0 
    return 'Loser!' if counter < win else 'Winner!'

def bingo(ticket, win):
    won = sum(chr(n) in xs for xs, n in ticket) >= win
    return 'Winner!' if won else 'Loser!'

def bingo(ticket, win):
    winner = sum(1 for stg, val in ticket if chr(val) in stg) >= win
    return "Winner!" if winner else "Loser!"

def bingo(ticket, win):
    mini_wins = sum(chr(code) in chars for chars, code in ticket)
    return 'Winner!' if mini_wins >= win else 'Loser!'

def bingo(ticket,win):
    mini_wins = 0
    for arr in ticket:
        mini_wins += any(map(lambda x: ord(x) == arr[1], arr[0]))
    return ['Loser!', 'Winner!'][mini_wins >= win]
